import {Component} from "react";

class Main extends Component{
    constructor(props){
        super(props);
        //Values that get passed to the component

        //Functions that need to get bound to this instance
        //this.function = this.function.bind(this);
        this.state = {
            key_id: 'PKHGR6CVRK7DTWFIB6Q1',
            secret_key: 'TpSauKJD8We5hu3vvXzwp2o7UrXBfR4uzxp4Z27n',
            ticker: 'TSLA',
        }
    }

    function(){
        console.log("Hi! :)")
    }

        //#region Onchange functions
        tickerChange(e) {
            this.setState({ticker: e.target.value});
        }
        idChange(e) {
            this.setState({key_id: e.target.value});
        }
        skChange(e) {
            this.setState({secret_key: e.target.value});
        }
        //#endregion

    render(){
        return(
            <div>
                {this.state.key_id}
            </div>
        )

    }
}

export default Main;
